import React from 'react'
import PropTypes from 'prop-types'
import './counter.css'
import useCounter from './useCounter'

const CounterWithcustomHook = () => {
    const { state, increment, decrement } = useCounter(100);
    return (
        <>
            <h1>Counter With Hook: { state }</h1>
            <hr></hr>
            <button onClick={ (e)=>increment(e) } className='btn btn-primary'>+1</button>
            <button onClick={ (e)=>decrement(e) } className='btn btn-warning'>-1</button>
        </>
    )
}

CounterWithcustomHook.propTypes = {}

export default CounterWithcustomHook
